import React, { useState, useEffect } from 'react'
import axios from 'axios'

const MarvelCharacters = () => {
  const [marvelCharactersList, setMarvelCharactersList] = useState([])

  useEffect(async () => {
    const result = await axios(
      `https://gateway.marvel.com:443/v1/public/characters?apikey=cc910b666eec23762ab78c8ca89332202ae580b8`
    )
    console.log(result.data)
    setMarvelCharactersList(result.data.data.results)
  }, [])

  return (
    <ul>
      {marvelCharactersList.map(item => (
        <li key={item.name}>
          <p>{item.name}</p>
          <p>{item.description}</p>
          <img src={item.comics}></img>
        </li>
      ))}
    </ul>
  )
}

export default MarvelCharacters
